import React, { Component } from "react";
import { connect } from "react-redux";
import Test from "./test";
import API from "../../services/api";
import { getOrderHistory } from "../../store/action/actions";

class OrderHistory extends Component {
  componentWillMount() {}

  renderProductList = products => {
    return Object.keys(products).map((product, key) => {
      return <td key={key}>{products[key].name} </td>;
    });
  };

  render() {
    return (
      <div>
        <div className="col-sm-8 mx-auto my-3">
          <table class="table">
            <thead>
              <tr>
                <th scope="col">Date</th>
                <th scope="col">Products</th>
                <th scope="col">Quantity</th>
                <th scope="col">Total amount</th>
              </tr>
            </thead>
            <tbody>
              {this.props.orderHistory.map((order, key) => (
                <tr>
                  <th scope="row">{order.date}</th>
                  {this.renderProductList(order.products)}

                  <td>{order.quantity}</td>
                  <td>{order.totalAmount}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    );
  }
}

const mapStateToProps = state => {
  return {
    products: state.rootReducer.products,
    user: state.rootReducer.user,
    orderHistory: state.rootReducer.orderHistory
  };
};

const mapDispatchToProps = dispatch => {
  return {
    getOrderHistory: id => dispatch(getOrderHistory(id))
  };
};

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(OrderHistory);
